-- ----------------------------
-- View structure for `server_aktivitaet`
-- ----------------------------
DROP VIEW IF EXISTS `server_aktivitaet`;
CREATE ALGORITHM=UNDEFINED DEFINER=`los3`@`%` SQL SECURITY DEFINER VIEW `server_aktivitaet` AS select `cp_aktivitaet`.`id` AS `id`,`cp_aktivitaet`.`usr_id` AS `usr_id`,`server_user`.`Username` AS `Username`,`server_user`.`fraktion` AS `fraktion`,date_format(from_unixtime(`cp_aktivitaet`.`login`),'%d.%m.%Y %H:%i:%s') AS `Login`,date_format(from_unixtime(`cp_aktivitaet`.`logout`),'%d.%m.%Y %H:%i:%s') AS `Logout`,round(((`cp_aktivitaet`.`logout` - `cp_aktivitaet`.`login`) / 60),0) AS `Spielminuten`,(`cp_aktivitaet`.`new_vermoegen` - `cp_aktivitaet`.`old_vermoegen`) AS `Vermoegen`,(`cp_aktivitaet`.`new_tickets` - `cp_aktivitaet`.`old_tickets`) AS `Tickets`,date_format(str_to_date(`cp_aktivitaet`.`datum`,'%d.%m.%Y'),'%d.%m.%Y') AS `Tag` from (`cp_aktivitaet` join `server_user` on((`server_user`.`id` = `cp_aktivitaet`.`usr_id`))) where ((str_to_date(`cp_aktivitaet`.`datum`,'%d.%m.%Y') >= str_to_date('30.12.2016','%d.%m.%Y')) and (str_to_date(`cp_aktivitaet`.`datum`,'%d.%m.%Y') < curdate()) and ((`cp_aktivitaet`.`logout` - `cp_aktivitaet`.`login`) > 0)) order by `server_user`.`Username`,str_to_date(`cp_aktivitaet`.`datum`,'%d.%m.%Y') ;

-- ----------------------------
-- View structure for `tb_outstanding`
-- ----------------------------
DROP VIEW IF EXISTS `tb_outstanding`;
CREATE ALGORITHM=UNDEFINED DEFINER=`los3`@`%` SQL SECURITY DEFINER VIEW `tb_outstanding` AS select `server_timeban`.`id` AS `id`,(`server_timeban`.`ban_time` + (`server_timeban`.`ban_length` * (select `los_faktor`.`faktor` from `los_faktor` where (`los_faktor`.`typ` = `server_timeban`.`ban_typ`)))) AS `ban_ablauf`,unix_timestamp() AS `ts`,`server_timeban`.`usr_id` AS `usr_id`,`server_timeban`.`usr_name` AS `usr_name`,`server_timeban`.`adm_name` AS `adm_name`,`server_timeban`.`status` AS `status`,`server_timeban`.`ban_length` AS `ban_length`,`server_timeban`.`ban_time` AS `ban_time`,`server_timeban`.`ban_typ` AS `ban_typ`,`server_timeban`.`ban_reason` AS `ban_reason`,date_format(from_unixtime((`server_timeban`.`ban_time` + (`server_timeban`.`ban_length` * (select `los_faktor`.`faktor` from `los_faktor` where (`los_faktor`.`typ` = `server_timeban`.`ban_typ`))))),'%d.%m.%Y - %H:%i:%s') AS `ablauf` from `server_timeban` where (((`server_timeban`.`ban_time` + (`server_timeban`.`ban_length` * (select `los_faktor`.`faktor` from `los_faktor` where (`los_faktor`.`typ` = `server_timeban`.`ban_typ`)))) > unix_timestamp()) and (`server_timeban`.`status` = 0)) ;

-- ----------------------------
-- View structure for `view_bans`
-- ----------------------------
DROP VIEW IF EXISTS `view_bans`;
CREATE ALGORITHM=UNDEFINED DEFINER=`los3`@`%` SQL SECURITY DEFINER VIEW `view_bans` AS select `server_ban`.`id` AS `id`,`server_ban`.`userID` AS `userID`,(select `server_user`.`Username` from `server_user` where (`server_user`.`id` = `server_ban`.`userID`)) AS `user`,date_format(from_unixtime(`server_ban`.`banTime`),'%d.%m.%Y') AS `datum`,date_format(from_unixtime(`server_ban`.`banTime`),'%H:%i:%s') AS `zeit`,(select `server_user`.`Username` from `server_user` where (`server_user`.`id` = `server_ban`.`adminID`)) AS `admin`,`server_ban`.`reason` AS `reason` from `server_ban` where ((`server_ban`.`typ` = 'ban') and (`server_ban`.`status` = 0)) ;

-- ----------------------------
-- View structure for `view_race`
-- ----------------------------
DROP VIEW IF EXISTS `view_race`;
CREATE ALGORITHM=UNDEFINED DEFINER=`los3`@`%` SQL SECURITY DEFINER VIEW `view_race` AS select `server_race`.`id` AS `rID`,`server_race`.`name` AS `rName`,`server_race`.`typ` AS `rTyp`,`server_race`.`startX` AS `rStartX`,`server_race`.`startY` AS `rStartY`,`server_race`.`startZ` AS `rStartZ`,`server_race`.`startA` AS `rStartA`,`server_race`.`created_user` AS `rCreateUser`,`server_race`.`created_time` AS `rCreateDate`,`server_race`.`edit_user` AS `rEditUser`,`server_race`.`edit_time` AS `rEditDate` from `server_race` ;
DROP TRIGGER IF EXISTS `autos_AFTER_UPDATE`;
DELIMITER ;;
CREATE TRIGGER `autos_AFTER_UPDATE` AFTER UPDATE ON `autos` FOR EACH ROW BEGIN
	IF (OLD.name <> NEW.name) THEN
		INSERT INTO `los3`.`cp_carlog`
		(`carid`,
		`old_ownerid`,
		`old_ownername`,
		`new_ownerid`,
		`new_ownername`,
		`datum`)
		VALUES
		(NEW.inter,
		(SELECT id FROM server_user WHERE username = OLD.name),
		OLD.name,
		(SELECT id FROM server_user WHERE username = NEW.name),
		NEW.name,
		UNIX_TIMESTAMP());
	END IF;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `server_ban_AFTER_INSERT`;
DELIMITER ;;
CREATE TRIGGER `server_ban_AFTER_INSERT` AFTER INSERT ON `server_ban` FOR EACH ROW BEGIN
	IF (NEW.typ = "ban" AND NEW.status = 0) THEN
		UPDATE cp_forum_userident SET statschanged = 1 WHERE usr_id = NEW.userID AND id > 0;
        UPDATE cp_ts3_userident SET statschanged = 1 WHERE usr_id = NEW.userID AND id > 0;
    END IF;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `server_ban_AFTER_UPDATE`;
DELIMITER ;;
CREATE TRIGGER `server_ban_AFTER_UPDATE` AFTER UPDATE ON `server_ban` FOR EACH ROW BEGIN
	IF (NEW.typ = "ban" AND NEW.status = 1) THEN
		UPDATE cp_forum_userident SET statschanged = 1 WHERE usr_id = NEW.userID AND id > 0;
        UPDATE cp_ts3_userident SET statschanged = 1 WHERE usr_id = NEW.userID AND id > 0;
    END IF;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `server_ban_AFTER_DELETE`;
DELIMITER ;;
CREATE TRIGGER `server_ban_AFTER_DELETE` AFTER DELETE ON `server_ban` FOR EACH ROW BEGIN
	IF (OLD.typ = "ban" AND OLD.status = 0) THEN
		UPDATE cp_forum_userident SET statschanged = 1 WHERE usr_id = OLD.userID AND id > 0;
        UPDATE cp_ts3_userident SET statschanged = 1 WHERE usr_id = OLD.userID AND id > 0;
    END IF;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `server_user_AFTER_UPDATE`;
DELIMITER ;;
CREATE TRIGGER `server_user_AFTER_UPDATE` AFTER UPDATE ON `server_user` FOR EACH ROW BEGIN
	DECLARE vHasLogin TINYINT;
    DECLARE vAktID INT;
    
SELECT 
    (SELECT 
            COUNT(*)
        FROM
            `los3`.`cp_aktivitaet`
        WHERE
            logout = - 1
                AND `los3`.`cp_aktivitaet`.usr_id = NEW.id
        ORDER BY login DESC
        LIMIT 1)
INTO vHasLogin;
SELECT 
    (SELECT 
            id
        FROM
            `los3`.`cp_aktivitaet`
        WHERE
            logout = - 1
                AND `los3`.`cp_aktivitaet`.usr_id = NEW.id
        ORDER BY login DESC
        LIMIT 1)
INTO vAktID;
    
	IF (OLD.loggedin <> NEW.loggedin) THEN
		IF (NEW.loggedin = 1) THEN
			IF (vHasLogin <> 1) THEN
				INSERT INTO `los3`.`cp_aktivitaet`
				(`usr_id`,`usr_name`,`login`,`old_tickets`,`old_spielminuten`,`old_vermoegen`,`datum`)
				VALUES (NEW.id,NEW.Username,UNIX_TIMESTAMP(),NEW.ti,NEW.zeit,(NEW.geld+NEW.bank),FROM_UNIXTIME(UNIX_TIMESTAMP(),'%d.%m.%Y'));
            END IF;
		END IF;
		IF (NEW.loggedin = 0) THEN
			IF (vHasLogin = 1) THEN
				UPDATE `los3`.`cp_aktivitaet`
				SET
				`logout` = UNIX_TIMESTAMP(),
				`new_tickets` = NEW.ti,
				`new_spielminuten` = NEW.zeit,
				`new_vermoegen` = (NEW.geld+NEW.bank)
				WHERE `los3`.`cp_aktivitaet`.`id` = vAktID;
			END IF;
		END IF;
	END IF;
	
	IF (OLD.Username <> NEW.Username) THEN
		INSERT INTO `los3`.`cp_namechanged`(`usr_id`,`datum`,`old_name`,`new_name`)
		VALUES(NEW.id,UNIX_TIMESTAMP(),OLD.Username,NEW.Username);
	END IF;
    
    IF (OLD.ip <> NEW.ip) THEN
		INSERT INTO `los3`.`cp_ipverlauf`(`usr_id`,`old_ip`,`new_ip`,`datum`)
		VALUES(NEW.id,OLD.ip,NEW.ip,UNIX_TIMESTAMP());
	END IF;
    
    IF (OLD.fraktion <> NEW.fraktion
		OR OLD.ausbilder <> NEW.ausbilder 
        OR OLD.leader <> NEW.leader 
        OR OLD.alevel <> NEW.alevel 
        OR OLD.burgermeister <> NEW.burgermeister
        OR (SELECT count(*) FROM view_bans WHERE userID = NEW.id) > 1
        OR OLD.Username <> NEW.Username
		) THEN
        UPDATE cp_forum_userident SET statschanged = 1 WHERE active = 1 AND usr_id = NEW.id AND cp_forum_userident.id > 0;
		UPDATE cp_ts3_userident SET statschanged = 1 WHERE active = 1 AND usr_id = NEW.id AND cp_ts3_userident.id > 0;
    END IF;
    
END
;;
DELIMITER ;
